import "./ListForm.css";

const ListForm = () => {
  return (
    <div className="listform">
      <form>
          <label className="listform-label">Enter List Item</label>
        <input type="text"></input>
        <button type="submit"> Add To List</button>
      </form>
    </div>
  );
};

export default ListForm;
